        <g ed:note="&lt;body style=&quot; font-family:'Arial'; font-size:9pt; font-weight:400; font-style:normal;&quot;>&lt;p style=&quot; margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;&quot;>&lt;span style=&quot; font-family:'Droid Serif,serif'; font-size:11.44pt; color:#000000;&quot;>Democrats de-facto Presidential nominee and Vice President Kamala Harris on Tuesday announced Minnesota Governor Tim Walz of Minnesota as her choice for running mate ahead of the November election.&lt;/span>&lt;/p>&lt;p style=&quot; margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;&quot;>&lt;span style=&quot; font-family:'Droid Serif,serif'; font-size:11.44pt; color:#000000;&quot;>The decision puts an end to the intense speculation about which candidate Kamala Harris would choose to face off against Donald Trump, the Republican nominee and former president, along with his vice-presidential pick, Ohio Senator JD Vance.&lt;/span>&lt;/p>&lt;p style=&quot; margin-top:12px; margin-bottom:12px; margin-left:0px; margin-right:0px; -qt-block-indent:0; text-indent:0px;&quot;>&lt;span style=&quot; font-family:'Droid Serif,serif'; font-size:11.44pt; color:#000000;&quot;>In an Instagram post, Vice President Kamala Harris wrote, &amp;quot;I am proud to announce that Iâ€™ve asked Tim walz to be my running mate.&amp;quot; She praised his deep commitment to middle-class families and shared that Walz's personal experiences, including his reliance on social security survivor benefits after his father's death and his use of the GI Bill for college, deeply resonate with her. Harris also noted Walz's diverse background, from coaching high school football to advising a gay-straight alliance, as significant in shaping his governance&lt;/span>&lt;/p>&lt;/body>">
            <use xlink:href="#imgnote" transform="translate(359,178)"/>
        </g>
